import React from "react";
import ReactDom from "react-dom";
import "./index.css";
var date = new Date();
var time = date.getHours();
var greeting = "";
if(time < 12){
  greeting = 'Good Morning';
}else if(time < 19){
  greeting = "Good AfterNoon";
}else{
  greeting = "Good Night";
}

ReactDom.render(
  <>
    <h1>hello Sir,{greeting} </h1>

  </>,document.getElementById("root")
);
